# Inheritance in Java

Inheritance is a fundamental concept in object-oriented programming (OOP) that allows one class to inherit the properties and behavior of another class. The inheriting class is called the subclass or derived class, and the class being inherited from is called the superclass or base class.

## Basic Syntax

The basic syntax for inheritance in Java is as follows:
```java
public class SuperClass {
    // properties and methods
}

public class SubClass extends SuperClass {
    // properties and methods
}
```
In this example, `SubClass` inherits all the properties and methods of `SuperClass`.

## Types of Inheritance

Java supports two types of inheritance:

1. **Single Inheritance**: A subclass can inherit from only one superclass.
2. **Multiple Inheritance**: A subclass can inherit from multiple superclasses (not directly supported in Java, but can be achieved using interfaces).

## Inheritance Hierarchy

The inheritance hierarchy is a tree-like structure that shows the relationship between classes. The superclass is at the top, and the subclass is at the bottom.

## Access Modifiers

Access modifiers control the accessibility of properties and methods in a class. Inheritance affects the access modifiers as follows:

* **Public**: Public properties and methods are inherited by subclasses.
* **Protected**: Protected properties and methods are inherited by subclasses, but can only be accessed within the subclass.
* **Private**: Private properties and methods are not inherited by subclasses.

## Example Use Case

Suppose we have a `Vehicle` class with properties `color` and `speed`, and methods `accelerate()` and `brake()`. We can create a `Car` class that inherits from `Vehicle` and adds its own properties and methods:
```java
public class Vehicle {
    public String color;
    public int speed;

    public void accelerate() {
        speed++;
    }

    public void brake() {
        speed--;
    }
}

public class Car extends Vehicle {
    public int numDoors;

    public void openDoors() {
        System.out.println("Doors opening...");
    }
}
```
In this example, `Car` inherits the `color` and `speed` properties, as well as the `accelerate()` and `brake()` methods from `Vehicle`. It also adds its own `numDoors` property and `openDoors()` method.

