# Rust Programming Language

Rust is a systems programming language that runs on the LLVM compiler infrastructure. It is designed to provide memory safety without using garbage collection, and to provide a way to write high-performance code that is also safe and easy to maintain.

## Features

* Memory Safety: Rust provides memory safety through its ownership system, which ensures that memory is properly deallocated when it is no longer needed.
