```rust
use std::thread;

fn main() {
    let handle = thread::spawn(|| {
        println!("Hello from thread!");
    });

    handle.join().unwrap();
}
```
In this example, we create a new thread that prints "Hello from thread!" to the console. We then use the `join` method to wait for the thread to finish and print the result.

